export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},Gi7WybtZIp:{data:{id:384,attributes:{imdbId:"tt11242218",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYmMxYmRlZDQtNjMyZi00NzVlLTkzODctODZiOTE5N2I1YTU0XkEyXkFqcGdeQXVyNjEwNTM2Mzc@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.6\u002F10"},{Source:"Rotten Tomatoes",Value:"21%"},{Source:"Metacritic",Value:"42\u002F100"}],item_lang:{data:{id:1047,attributes:{title:e,plot:"A journey into uncharted and forbidden territory through three tales tangled in space and time.",slug:"books-of-blood"}}},books:{data:[{id:3358,attributes:{title:e,description:"A landmark collector's edition of short stories by an immensely popular horror writer brings back the terrifying tales with which he first gained acclaim. Reprint.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=q9hoAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"1998-01-01",publisher:h,subtitle:"Volumes One to Three"}},{id:3359,attributes:{title:e,description:"Volume Four of Clive Barker's seminal Books of Blood contains the stories: 'The Body Politic', 'The Inhuman Condition', 'Revelations', 'Down, Satan!', 'The Age of Desire'. With the 1984 publication of Books of Blood, Clive Barker became an overnight literary sensation. He was hailed by Stephen King as \"the future of horror\", and won both the British and World Fantasy Awards. Now, with his numerous bestsellers, graphic novels, and hit movies like the Hellraiser, Clive Barker has become an industry unto himself. But it all started here, with this tour de force collection that rivals the dark masterpieces of Edgar Allan Poe. Read him and rediscover the true meaning of fear.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=P5eDCgAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2015-10-26",publisher:"Sphere",subtitle:d}},{id:3360,attributes:{title:"Books of Blood, Vol. 1",description:"EVERYBODY IS A BOOK OF BLOOD; WHEREVER WE'RE OPENED, WE'RE RED. â€” Clive Barker Few authors can claim to have marked a genre so thoroughly and personally that their words have leaked into every aspect of modern pop culture. Clive Barker is such an author, and the Books of Blood marked his debut - his coming out to the world - in brilliant, unforgettable fashion. Crossroad Press is proud to present Clive Barker's \"Books of Blood\" in digital for the first time. The Books of Blood combine the ordinary with the extraordinary while radiating the eroticism that has become Barker's signature. Weaving tales of the everyday world transformed into an unrecognizable place, where reason no longer exists and logic ceases to explain the workings of the universe, Clive Barker provides the stuff of nightmares in packages too tantalizing to resist. Never one to shy away from the unimaginable or the unspeakable, Clive Barker breathes life into our deepest, darkest nightmares, creating visions that are at once terrifying, tender, and witty. The Books of Blood confirm what horror fans everywhere have known for a long time: We will be hearing from Clive Barker for many years to come. This first volume contains the short stories : \"The Book of Blood,\" \"The Midnight Meat Train,\" \"The Yattering and Jack,\" \"Sex, Death, and Starshine,\" and \"In the Hills, the Cities,\" as well as the original introduction to volumes one, two, and three by Ramsey Campbell, and a new introduction by author David Niall Wilson.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=IFU_DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2017-11-19",publisher:"Crossroad Press",subtitle:d}},{id:3361,attributes:{title:"Clive Barker's Books of Blood: Volume One (Movie Tie-In)",description:"\"Everybody is a book of blood; wherever we're opened, we're red. In this tour de force collection of brilliantly disturbing tales, Clive Barker combines the extraordinary with the ordinary, bringing to life our darkest nightmares with stories that both seduce and devour. As beautiful as they are terrible, the pages of this volume are stained with unsettling imagery, macabre humor, and visceral dread. Here then are the stories written on the Book of Blood. Read, if it pleases you, and learn....\"--Provided by publisher.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=X1j6DwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2020-09-29",publisher:h,subtitle:d}},{id:3362,attributes:{title:"Clive Barker's Books of Blood",description:"Six horror stories deal with a haunted theater, messages from the dead, a series of gruesome subway murders, demons, cannibalism, and a monstrous giant",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=EJgUe1KKHm0C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"1986-01-01",publisher:"Berkley Publishing Group",subtitle:d}}]}}},meta:{}}},prerenderedAt:1681703486049}}("Clive Barker","movie",null,"","Books of Blood","series",1,"Berkley"))